import React, { useEffect, useRef, useState } from 'react';
import axios from "axios";
import { useNavigate } from 'react-router-dom';
function Bsolo1r() {
    const table = useRef()
    const navigate=useNavigate();
    const [pd,spd] = useState([])
    let rendr = []
    const tab = document.createElement('tr')
    useEffect(()=>{
        const sr=async()=>{
            await axios.get("http://localhost:4000/bs1r").then(d=>spd((d.data.bsolo1))).then(i=>{

                pd.forEach((i)=>{
                    tab.innerHTML += `
                    <td>${i.position}</td>
                    <td>${i.gamename}</td>
                    <td>${i.kills}</td>
                    <td>${i.kills*5}</td></br>
    
                    `
                })
            })
            table.current.append(tab)
        }
        sr();
    },[]);
    const cr = () => {
        navigate("/result");
      };
  return (
    <div className="sr">
      <div className="rc">
        <button id="rc" onClick={cr}>
          X
        </button>
      </div>
      <div className="pd">
        <div className="w">WINNER : 100</div>
        <div className="r">RUNNER : 50</div>
        <div className="k">KILL : 10</div>
      </div>
      <table ref={table}>
        <tr>
            
          <th>POSITION</th>
          <th>PLAYER NAME</th>
          <th>KILLS</th>
          <th>CASH</th>
        </tr>
            
           
                    
                
                
                
            
      </table>
    </div>
  )
}
export default Bsolo1r
